import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../assests/basilurlogo.png';
import meshBackground from '../assests/mesh-163.png'; // Import mesh background

const AdminPage = () => {
  return (
    <div
      className="min-h-screen flex flex-col"
      style={{
        backgroundImage: `url(${meshBackground})`, // Set mesh as background
        backgroundSize: 'cover',
        backgroundPosition: 'center',
      }}
    >
      {/* Header */}
      <header
        className="flex items-center p-2 mt-4 mx-auto"
        style={{
          backgroundColor: '#ffffff', // White background for contrast
          boxShadow: '0 4px 10px rgba(0, 0, 0, 0.1)',
          color: '#381e10',
          borderRadius: '50px',
          height: '60px',
          width: '80%',
        }}
      >
        <div className="flex items-center">
          <img src={logo} alt="Logo" className="h-8" />
        </div>
        <div className="flex-1 text-center">
          <h1 className="text-2xl font-bold" style={{ color: '#381e10' }}>
            Admin Dashboard
          </h1>
        </div>
      </header>

      {/* Buttons */}
      <div className="flex justify-center gap-6 mt-8">
        <Link to="/add-freight-agent">
          <button
            className="p-3 rounded-md border-2 text-lg"
            style={{
              borderColor: '#ab7523',
              backgroundColor: 'transparent',
              color: '#ab7523',
              transition: 'background-color 0.3s ease, color 0.3s ease',
            }}
            onMouseOver={(e) => {
              e.target.style.backgroundColor = '#ab7523';
              e.target.style.color = '#ffffff';
            }}
            onMouseOut={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#ab7523';
            }}
          >
            Add Freight Agent
          </button>
        </Link>

        <Link to="/add-freight-coordinator">
          <button
            className="p-3 rounded-md border-2 text-lg"
            style={{
              borderColor: '#ab7523',
              backgroundColor: 'transparent',
              color: '#ab7523',
              transition: 'background-color 0.3s ease, color 0.3s ease',
            }}
            onMouseOver={(e) => {
              e.target.style.backgroundColor = '#ab7523';
              e.target.style.color = '#ffffff';
            }}
            onMouseOut={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#ab7523';
            }}
          >
            Add Freight Coordinator
          </button>
        </Link>

        <Link to="/add-main-user">
          <button
            className="p-3 rounded-md border-2 text-lg"
            style={{
              borderColor: '#ab7523',
              backgroundColor: 'transparent',
              color: '#ab7523',
              transition: 'background-color 0.3s ease, color 0.3s ease',
            }}
            onMouseOver={(e) => {
              e.target.style.backgroundColor = '#ab7523';
              e.target.style.color = '#ffffff';
            }}
            onMouseOut={(e) => {
              e.target.style.backgroundColor = 'transparent';
              e.target.style.color = '#ab7523';
            }}
          >
            Add Main User
          </button>
        </Link>
      </div>
    </div>
  );
};

export default AdminPage;
